export default function Contact() {
  return (
    <div className="w-3/5 text-center mx-auto">
      <h2 className="text-4xl">Want More?</h2>
      <h3 className="text-2xl font-normal">I'd love to chat!</h3>
      <a href="">Email: matthewbasile2@gmail.com</a>
    </div>
  )
}
